export function diets(d) {
    if (typeof d === "string"){
        return d
    }else{
        return d.name
    }
  }

export function steps(data){
    if (typeof data === "string"){
        return data
    }else{
        data.steps[0].steps.map(i=>"Step" + i.number + ":" + i.step)
    }
}
